// DietObesity3.js
import React from 'react';
import './DietRecommendation.css';

const DietObesity3 = () => {
  return (
    <div className="diet-container">
      <h1>Diet Recommendations for Obesity Level 3</h1>
      <table className="diet-table">
        <thead>
          <tr>
            <th>Day</th>
            <th>Breakfast</th>
            <th>Lunch</th>
            <th>Dinner</th>
          </tr>
        </thead>
        <tbody>
          {Array.from({ length: 7 }, (_, i) => (
            <tr key={i}>
              <td>Day {i + 1}</td>
              <td>Breakfast info for Day {i + 1}</td>
              <td>Lunch info for Day {i + 1}</td>
              <td>Dinner info for Day {i + 1}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default DietObesity3;
